import React, { useState } from "react";
import { CustomButton } from "../../components/common/button/btn";
import { PasswordInput } from "../../components/common/input";

const TalkTab = () => {
  const [locked, setLocked] = useState(true);
  return (
    <div className='flex gap-2 items-center rounded bg-gray-100 dark:bg-dark-700  hover:shadow-white py-2 px-2'>
      {locked ? (
          <h3 className='text-gray-800 dark:text-gray-200  text-base'>
          let talk football
        </h3>
      ) : (
          <PasswordInput placeholder='Password' />
      )}
      {locked ? (
        <CustomButton
          className='bg-primary-800 text-sm '
          onClick={() => setLocked(false)}
        >
          Locked
        </CustomButton>
      ) : (
        <CustomButton className='bg-primary-800 text-sm '>Join</CustomButton>
      )}
    </div>
  );
};

export default TalkTab;
